webpackJsonp([120678318354],{508:function(o,t){o.exports={data:{markdownRemark:{html:"<p>我们是来自三个不同城市的闷骚程序员，关于这个 blog 大多是我们自嗨、吐槽、写作的地方，当然如果能够对你有所帮助那自然是极好的。如果你对此感兴趣，欢迎常来。</p>\n<h2>leon</h2>\n<p><code>&#x3C;男/></code> <code>&#x3C;成都/></code> <code>&#x3C;前端攻城狮/></code> <code>&#x3C;dota/></code></p>\n<blockquote>\n<p>凡事总须研究，才会明白。古来时常吃人，我也还记得，可是不甚清楚。我翻开历史一查，这历史没有年代，歪歪斜斜的每叶上都写着“ 仁义道德 ”几个字。我横竖睡不着，仔细看了半夜，才从字缝里看出字来，满本都写着两个字是“ 吃人 ”！</p>\n</blockquote>",frontmatter:{date:"March 19, 2018",path:"/about-us",title:"关于我们",author:"leon",dsct:"基佬四人行"}}},pathContext:{}}}});
